// use std::{collections::HashMap, hash::Hash};
use std::collections::HashMap;
impl Solution {
    pub fn min_window(s: String, t: String) -> String {
        let mut needed_count : HashMap<char, i32> = HashMap::new();
        for c in t.chars() {
            *needed_count.entry(c).or_insert(0i32)+=1;
        }

        let mut start : usize = 0; // inclusive
        let mut end : usize = 0; // exclusive
        let len : usize = s.len();
        let s : Vec<char> = s.chars().collect();

        let mut min_len : usize = 100001;
        let mut min_start : usize = 0;
        while end < len {
            while end < len && needed_count.iter().any(|(_, &c)|{c>0}) {
                let new_char : char = s[end];
                if let Some(count) = needed_count.get_mut(&new_char) {
                    *count-=1;
                }
                end += 1;
            }

            while start < len && needed_count.iter().all(|(_, &c)|{c<=0}) {
                let sub_len : usize = end - start;
                if sub_len < min_len {
                    min_start = start;
                    min_len = sub_len;
                }

                let removed_char : char = s[start];
                if let Some(count) = needed_count.get_mut(&removed_char) {
                    *count+=1;
                }
                start += 1;
            }
        }

        if min_len == 100001 {
            "".to_owned()
        } else {
            let min_end : usize = min_start + min_len; // exclusive
            // println!("s.len()={},min_start={},min_end={}",s.len(), min_start, min_end);
            s[min_start..min_end].iter().collect()
            // s.iter().enumerate().filter(|&(i,v)|{i>=min_start && i <= min_end}).map(|(_,&v)|{v}).collect()
        }
    }

    pub fn my_min_window(s: String, t: String) -> String {
        // needed_char_count[i] is positive implies we need char i. 
        let mut needed_char_count = vec![0;128];
        let mut contained_char_count = 0; // # of chars in T contained in the subs
        for c in t.chars() {
            needed_char_count[c as usize] += 1;
        }

        let mut start = 0usize; // inclusive
        let mut end = 0usize;  // inclusive
        let n = s.len();
        let mut min_start = 0usize;
        let mut min_len = 100000001usize;

        // reference a n-th char in a string require for linear complexity.
        // transform to a char vector to avoid this issue.
        let ss: Vec<char> = s.chars().collect();
        while end < n {
            let end_char = ss[end] as usize;
            if needed_char_count[end_char] > 0 {contained_char_count+=1;}
            needed_char_count[end_char]-=1;

            end+=1;
            // println!("start={}, end={}", start, end);
            while contained_char_count == t.len() {
                if (end-start) < min_len {
                    min_start = start;
                    min_len = end -start;
                }

                let start_char = ss[start as usize] as usize;
                needed_char_count[start_char]+=1;
                if needed_char_count[start_char] > 0 {contained_char_count-=1;}

                start+=1;
            }

        }
        if min_len <= s.len() {
            s.as_str()[min_start..min_start+min_len].to_owned()
        } else {
            "".to_owned()
        }
    }
}

